import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import MS from './ms';
import WS from './ws';
import MD from './md';
import WD from './wd';
import XD from './xd';
import './header.css';

class NavBar extends Component {
    render() {
        return (
            <Router>
                <div className="header">
                    <h1 class="nav">Duke Club Badminton</h1>
                    <nav className="nav">
                        <ul>
                            <li class="noSelect"><Link to="/add" style={{ color: 'inherit', textDecoration: 'inherit'}}>Add</Link></li>
                            <li class="noSelect"><Link to="/xd" style={{ color: 'inherit', textDecoration: 'inherit'}}>XD</Link></li>
                            <li class="noSelect"><Link to="/wd" style={{ color: 'inherit', textDecoration: 'inherit'}}>WD</Link></li>
                            <li class="noSelect"><Link to="/md" style={{ color: 'inherit', textDecoration: 'inherit'}}>MD</Link></li>
                            <li class="noSelect"><Link to="/ws" style={{ color: 'inherit', textDecoration: 'inherit'}}>WS</Link></li>
                            <li class="noSelect"><Link to="/ms" style={{ color: 'inherit', textDecoration: 'inherit'}}>MS</Link></li>
                        </ul>
                    </nav>
                </div>
                <Route path="/ms" component={MS}/>
                <Route path="/ws" component={WS}/>
                <Route path="/md" component={MD}/>
                <Route path="/wd" component={WD}/>
                <Route path="/xd" component={XD}/>
            </Router>
        );
    }
}

export default NavBar;
